import Vue from 'vue'
import App from './pages/App.vue'
import VueRouter from 'vue-router';
import Routes from './routes.js';
Vue.config.productionTip = false;
Vue.use(VueRouter);


const router = new VueRouter({
  routes: Routes,
});

new Vue({
  el: '#app',
  render: h => h(App),
  router: router,
});
